    :root {--background: #333;--Good: #464;--Bad: #446;--Neutral: #444;--primary: rgb(100, 64, 105);--link: rgb(103, 194, 255);}h1, h2, h3 {font-family: 'Poppins', sans-serif;}body {font-family: 'Noto Serif', serif;color: white;background-color: var(--background);z-index: 9999;margin-left: 20px;margin-right: 20px;}a {color: var(--link);text-decoration: none;}.content {position: fixed;left: 0;right: 0;z-index: 9999;margin-left: 20px;margin-right: 20px;}html, body {max-width: 100%;overflow-x: hidden;}.snpdiv {background-color: var(--Neutral);padding-left: 20px;padding-right: 20px;padding-top: 20px;padding-bottom: 20px;}.Good {background-color: var(--Good);}.Bad {background-color: var(--Bad);}.snpdiv-header {display: flex;flex-direction: row;}.header-main {flex-grow: 4;}.magnitude {text-align: right;padding-right: 25px;padding-left: 10px;margin: auto;height: 50%;}.arrow {text-align: right;cursor: pointer;user-select: none;margin: auto;height: 50%;}.arrow-up {transition: 300ms;transform: rotate(180deg);}.arrow-down {transition: 300ms;transform: rotate(0deg);}.snpdiv p {margin-bottom: 0;}a {cursor: pointer;}.search-bar {display: flex;flex-direction: row;align-items: center;justify-content: center;width: 40%;}.check-box {border-radius: 3px;margin-right: 20px;margin-left: 20px;}.check-boxes {display: flex;flex-direction: row;align-items: center;justify-content: center;}button {cursor: pointer;margin-left: 10px;height: 30px;}#search-bar {width: 80%;height: 30px;border: 0px solid var(--background);border-radius: 3px;padding-left: 10px;padding-right: 10px;}label {justify-content: center;font-family: Poppins, sans-serif;}#logo {height: auto;margin-left: 20px;margin-right: 20px;}.nav-wrapper {position: fixed;top: 0;left: 0;right: 0;z-index: 9999;background-color: var(--primary);display: flex;flex-direction: row;align-items: center;justify-content: space-between;padding-left: 20px;padding-right: 20px;}img {display: block;margin: 0 auto;width: 300px;user-select: none;pointer-events: none;}#search-button, #clear-button, #back-button {height: 35px;border: 2px solid rgb(255, 255, 255);border-radius: 10px;background-color: var(--primary);font-family: 'Poppins', sans-serif;color: #fff;}.input-check {border: 5px solid #fff;border-radius: 3px;height: 20px;width: 20px;font-family: Poppins, sans-serif;outline: #fff;margin: 0px;}#checkbox-Good {accent-color: var(--Good);}#checkbox-Bad {accent-color: var(--Bad);}#checkbox-neutral {accent-color: var(--Neutral);}.input-check:not(:checked) {opacity: 0;}.check-outline {border: 2px solid #fff;border-radius: 3px;height: 20px;width: 20px;font-family: Poppins, sans-serif;outline: #fff;margin: auto;}#summary {text-align: center;}.table-wrapper {display: flex;flex-direction: row;align-items: center;justify-content: center;margin-top: 20px;margin-bottom: 20px;}th {text-align: center;font-family: 'Poppins', sans-serif;font-size: 20px;padding: 10px;}td {text-align: center;font-family: 'Noto Serif', serif;font-size: 20px;padding: 10px;border: 1px solid #ccc;}table {border-collapse: collapse;border: 1px solid #ccc;border-radius: 3px;margin: 0 auto;}svg text{-webkit-user-select: none;-moz-user-select: none;-ms-user-select: none;user-select: none;}
